import React, { Component } from 'react';
import logo from './logo.svg';
import './master.css';
import Search from './components/pages/Search';

class App extends Component {
  render() {
    return (
      <div>
        <Search history={this.props.history}/>
      </div>
    );
  }
}

export default App;
